import React, { useState } from 'react';
import Nav from './Nav';
import useFetchUser from './useFetchUser';
import { useNavigate } from 'react-router-dom';

function myPage() {
    const { user } = useFetchUser();
    const navigation = useNavigate();

    return (
        <div>
            <div>
                <Nav user={user} />
            </div>
        </div>
    );
}

export default myPage;
